import CustomButton from "../CustomButton"
const options = [
  { value: 'google', label: 'Google' }
]

const NavBar = () => {
  const [isOpen, setIsOpen] = useState(false);


  const IconButton = ({ path }: { path: string }) => {
    return (<CustomButton className="text-[14px] font-medium flex justify-center items-center">
      <img src={`images/${path}`} alt='logo' />
    </CustomButton>
    )
  }
  return (
    <nav className="p-5 bg-white shadow-md flex items-center justify-between px-6">
    {/* Left Section */}
    <div className="flex items-center gap-2">
      <p className="text-black text-[16px] font-bold">Review</p>
      <select className="border-2 border-[#4D4CAC] text-black text-[16px] min-w-[120px] h-[40px] rounded-[8px]">
        {/* Dummy Options */}
        <option value="1">Option 1</option>
        <option value="2">Option 2</option>
      </select>
      <button className="bg-[#40E1FA1A] text-[#2CA01D] text-[12px] font-bold px-4 py-2 rounded-md">
        Quickbook’s Data
      </button>
    </div>

    {/* Mobile Toggle Button */}
    <button
      className="md:hidden text-black text-2xl"
      onClick={() => setIsOpen(!isOpen)}
    >
      {isOpen ? "✖" : "☰"}
    </button>

    {/* Right Section (Hidden on Small Screens) */}
    <div
      className={`absolute md:static top-[60px] left-0 w-full md:w-auto bg-white md:bg-transparent p-4 md:p-0 shadow-md md:shadow-none flex flex-col md:flex-row md:items-center gap-2 transition-all duration-300 ${
        isOpen ? "block" : "hidden md:flex"
      }`}
    >
      <IconButton path="search.svg" />
      <button className="text-[14px] font-medium">Export to Excel</button>
      <button className="text-[14px] font-medium">Add Document</button>
      <button className="text-[14px] font-medium">Connect</button>
      <IconButton path="bell.svg" />
      <IconButton path="settings.svg" />
      <IconButton path="person.svg" />
    </div>
  </nav>
  )
}

export default NavBar
